{$I-}{$R-}
 
program Temirlan3;
 
type
   triangleType = (Sharp, blunt, right);
 
var a, b, c: real;
      T1, T2: triangleType;
      answer: char;
      r: integer;
      tryAgain: boolean;
 
function getTriangleType (a, b, c: real): triangleType;
var angleA, angleB, angleC: real;
begin
    angleA := (b*b+c*c-a*a)/(2*b*c);
    angleB := (a*a+c*c-b*b)/(2*a*c);
    angleC := (a*a+b*b-c*c)/(2*a*b);
    if (angleA < 0) or (angleB < 0) or (angleC < 0) then
       getTriangleType := blunt
    else if (angleA = 0) or (angleB = 0) or (angleC = 0) then
       getTriangleType := right
    else
       getTriangleType := sharp;
end;
 
function isCorrectTriangle (a, b, c: real): boolean;
begin
    if (a <= 0) or (b <= 0) or (c <= 0) then
        isCorrectTriangle := false
    else if (a < b+c) and (b < a+c) and (c < a+b) then isCorrectTriangle := true
    else
         isCorrectTriangle := false;
end;
 
procedure getCorrectInput ();
begin
    repeat
       read (a, b, c);
    r := IOResult;
    if r <> 0 then begin
       writeln ('Wrong sequance. Do you want to try again? (Y/N)');
       repeat
          read (answer);
       until (answer = 'Y') or (answer = 'N');
          if answer = 'N' then tryAgain := false
          else tryAgain := true;
    end;
    until (r = 0) or (not tryAgain);
end;
 
begin
    repeat
       getCorrectInput;
       if not tryAgain then begin
       if isCorrectTriangle( a, b, c ) then
          T1 := getTriangleType( a, b, c )
       else begin
        writeln ('Not Correct Triangle. Do you want to try again? (Y/N)');
        repeat
           read (answer);
        until (answer = 'Y') or (answer = 'N');
        if answer = 'N' then tryAgain := false;
       end;
       end;
    until not tryAgain;
    writeln ('Program exited');
    readln;
end.
